import React, { useState } from 'react';
import Header from '../sharedpages/header';
import Navbar from '../sharedpages/navbar';
import Footer from '../sharedpages/footer';
import './ContentPreview.css';

const ContentPreview = () => {
  const [activeTab, setActiveTab] = useState('content');
  const [activeContentTab, setActiveContentTab] = useState('landing-page');

  // Mock data for preview - in a real app, this would come from the edited content
  const previewData = {
    hero: {
      headline: 'Find Your Perfect Commercial Property',
      subheading: 'Discover premium office spaces, retail locations, and industrial facilities. Connect with property owners and find the ideal space for your business growth.',
      backgroundImage: '/hero-background.jpg',
      buttonText: 'Start Your Search',
      buttonUrl: '/properties'
    },
    howItWorks: {
      title: 'How It Works',
      steps: [
        {
          id: 1,
          title: 'Find Your Space',
          description: 'Browse our extensive database of commercial properties',
          image: '/step1-image.jpg',
          stepNumber: 1
        },
        {
          id: 2,
          title: 'Connect with Brokers',
          description: 'Get in touch with experienced property professionals',
          image: '/step2-image.jpg',
          stepNumber: 2
        },
        {
          id: 3,
          title: 'Secure Your Lease',
          description: 'Complete your transaction with confidence',
          image: '/step3-image.jpg',
          stepNumber: 3
        }
      ]
    },
    team: {
      title: 'Our Team',
      members: [
        {
          id: 1,
          name: 'Ethan Carter',
          role: 'CEO',
          image: '/ethan-carter.jpg'
        },
        {
          id: 2,
          name: 'Sophia Bennett',
          role: 'Head of Sales',
          image: '/sophia-bennett.jpg'
        },
        {
          id: 3,
          name: 'Liam Harper',
          role: 'Lead Developer',
          image: '/liam-harper.jpg'
        },
        {
          id: 4,
          name: 'Olivia Hayes',
          role: 'Marketing Manager',
          image: '/olivia-hayes.jpg'
        }
      ]
    },
    contact: {
      companyName: 'PropertyConnect Solutions',
      physicalAddress: '123 Business District, Suite 456, Downtown, City Center 12345',
      phoneNumber: '+1 (555) 123-4567',
      emailAddress: 'info@propertyconnectsolutions.com',
      contactFormRecipientEmail: 'contact@propertyconnectsolutions.com'
    },
    faq: {
      title: 'Frequently Asked Questions',
      entries: [
        {
          id: 1,
          question: 'How do I list my property on the platform?',
          answer: 'What is the process for listing a property?'
        },
        {
          id: 2,
          question: 'What types of properties can I find on this platform?',
          answer: 'Our platform offers a wide range of commercial properties, including office spaces, retail locations, and industrial facilities.'
        },
        {
          id: 3,
          question: 'How can I contact customer support?',
          answer: 'You can contact us through the contact form on our website or by emailing our support team.'
        }
      ]
    },
    disclaimer: `This platform is provided "as is" without any warranties, express or implied. We make no representations about the accuracy, completeness, or reliability of any information, products, services, or related graphics contained on this platform for any purpose.`,
    legalTerms: `TERMS AND CONDITIONS OF USE

1. ACCEPTANCE OF TERMS
By accessing and using this platform, you accept and agree to be bound by the terms and provision of this agreement.`
  };

  const handlePublishChanges = () => {
    console.log('Publishing changes to live site');
    alert('Changes have been published successfully!');
    // Navigate back to content management
    window.location.href = '/dashboard/content-management';
  };

  const handleBack = () => {
    // Navigate back to content management
    window.location.href = '/dashboard/content-management';
  };

  const renderLandingPagePreview = () => (
    <div className="preview-section">
      <h3 className="preview-section-title">Landing Page Preview</h3>
      
      {/* Hero Section */}
      <div className="hero-preview">
        <div className="hero-image">
          <img src={previewData.hero.backgroundImage} alt="Hero background" />
          <div className="hero-overlay">
            <h1 className="hero-headline">{previewData.hero.headline}</h1>
            <p className="hero-subheading">{previewData.hero.subheading}</p>
            <button className="hero-button">{previewData.hero.buttonText}</button>
          </div>
        </div>
      </div>

      {/* Featured Listings */}
      <div className="featured-listings">
        <h3 className="preview-section-title">Featured Listings</h3>
        <div className="listings-grid">
          <div className="listing-card">
            <img src="/office-space.jpg" alt="Modern Office Space" />
            <h4>Modern Office Space in Downtown</h4>
            <p>Contemporary office space with flexible layouts and stunning city views.</p>
          </div>
          <div className="listing-card">
            <img src="/retail-space.jpg" alt="Prime Retail Location" />
            <h4>Prime Retail Location in City Center</h4>
            <p>High-traffic retail space with excellent visibility and customer access.</p>
          </div>
          <div className="listing-card">
            <img src="/warehouse.jpg" alt="Spacious Warehouse" />
            <h4>Spacious Warehouse with Easy Access</h4>
            <p>Large warehouse facility with ample storage and convenient transportation links.</p>
          </div>
        </div>
      </div>

      {/* Testimonials */}
      <div className="testimonials">
        <h3 className="preview-section-title">Testimonials</h3>
        <div className="testimonials-grid">
          <div className="testimonial-card">
            <div className="testimonial-header">
              <img src="/sarah-chen.jpg" alt="Sarah Chen" className="testimonial-avatar" />
              <div className="testimonial-info">
                <h4>Sarah Chen</h4>
                <span>2 months ago</span>
                <div className="rating">★★★★★</div>
              </div>
            </div>
            <p>"This platform was instrumental in finding the perfect office space for our growing team. The listings were accurate, and the support was exceptional."</p>
          </div>
          <div className="testimonial-card">
            <div className="testimonial-header">
              <img src="/david-lee.jpg" alt="David Lee" className="testimonial-avatar" />
              <div className="testimonial-info">
                <h4>David Lee</h4>
                <span>3 months ago</span>
                <div className="rating">★★★★☆</div>
              </div>
            </div>
            <p>"The team provided valuable insights and guidance throughout the process. We are very satisfied with our new retail location."</p>
          </div>
        </div>
      </div>
    </div>
  );

  const renderContactPreview = () => (
    <div className="preview-section">
      <h3 className="preview-section-title">Contact Information Preview</h3>
      <div className="contact-preview">
        <h4>{previewData.contact.companyName}</h4>
        <p><strong>Address:</strong> {previewData.contact.physicalAddress}</p>
        <p><strong>Phone:</strong> {previewData.contact.phoneNumber}</p>
        <p><strong>Email:</strong> {previewData.contact.emailAddress}</p>
        <p><strong>Contact Form Recipient:</strong> {previewData.contact.contactFormRecipientEmail}</p>
      </div>
    </div>
  );

  const renderFAQPreview = () => (
    <div className="preview-section">
      <h3 className="preview-section-title">FAQ Preview</h3>
      <div className="faq-preview">
        <h4>{previewData.faq.title}</h4>
        {previewData.faq.entries.map((faq) => (
          <div key={faq.id} className="faq-item">
            <h5>Q: {faq.question}</h5>
            <p>A: {faq.answer}</p>
          </div>
        ))}
      </div>
    </div>
  );

  const renderDisclaimerPreview = () => (
    <div className="preview-section">
      <h3 className="preview-section-title">Disclaimer Preview</h3>
      <div className="disclaimer-preview">
        <p>{previewData.disclaimer}</p>
      </div>
    </div>
  );

  const renderLegalTermsPreview = () => (
    <div className="preview-section">
      <h3 className="preview-section-title">Legal Terms Preview</h3>
      <div className="legal-terms-preview">
        <pre>{previewData.legalTerms}</pre>
      </div>
    </div>
  );



  const renderContent = () => {
    switch (activeContentTab) {
      case 'landing-page':
        return renderLandingPagePreview();
      case 'contact':
        return renderContactPreview();
      case 'faq':
        return renderFAQPreview();
      case 'disclaimer':
        return renderDisclaimerPreview();
      case 'legal-terms':
        return renderLegalTermsPreview();

      default:
        return renderLandingPagePreview();
    }
  };

  return (
    <div className="content-preview-page">
      <Header />
      <div className="dashboard-container">
        <Navbar activeTab={activeTab} setActiveTab={setActiveTab} />
        <main className="main-content">
          {/* Breadcrumb */}
          <div className="breadcrumb">
            Content Management / Content Preview
          </div>

          {/* Page Title and Back Button */}
          <div className="page-header">
            <div className="page-title-section">
              <h1 className="page-title">Content Preview</h1>
              <p className="page-description">Review all changes before publishing to the live site</p>
            </div>
            <button 
              className="back-btn"
              onClick={handleBack}
            >
              Back
            </button>
          </div>

          {/* Content Type Tabs */}
          <div className="content-tabs">
            <button 
              className={`content-tab ${activeContentTab === 'landing-page' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('landing-page')}
            >
              Landing Page
            </button>
            <button 
              className={`content-tab ${activeContentTab === 'contact' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('contact')}
            >
              Contact
            </button>
            <button 
              className={`content-tab ${activeContentTab === 'faq' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('faq')}
            >
              FAQ
            </button>
            <button 
              className={`content-tab ${activeContentTab === 'disclaimer' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('disclaimer')}
            >
              Disclaimer
            </button>
            <button 
              className={`content-tab ${activeContentTab === 'legal-terms' ? 'active' : ''}`}
              onClick={() => setActiveContentTab('legal-terms')}
            >
              Legal Terms
            </button>

          </div>

          {/* Preview Content */}
          <div className="preview-content">
            {renderContent()}
          </div>

          {/* Publish Button */}
          <div className="publish-section">
            <button 
              className="publish-btn"
              onClick={handlePublishChanges}
            >
              Publish Changes
            </button>
          </div>
        </main>
      </div>
      <Footer />
    </div>
  );
};

export default ContentPreview;
